	  290695,"3",17700,NULL,1978,
	  "1.50 CAD",48.000,NULL,"Phantacea Three is a flip book. The front cover Helios on the Moon is by Richard (nowadays Ricardo) Sandoval. Its half of the book continues the Helios on the Moon sequence begun with the Launching of the Cosmic Express in Phantacea One and the Star Child - Mik Starrus Lord Yajur sequence in Phantacea Two. The first section is drawn by Peter Lynde. It's continued with a sequence drawn by Richard Sandoval. Helios on the Moon continues in Phantacea Four.The flip side of the comic The Damnation Brigade has a cover by Ian Bateson. It continues the Vayu Maelstrom (Devil Wind) and D-Brig storylines from Phantacea Two. In terms of the Phantacea Mythos this sequence is called \"The War of the Apocalyptics\". The stories are drawn by Ian Bateson Verne Andrusiek (nowadays Andru) and Carl Muecke. The map of Sedon's Head is by Tim Hammell. The combined sequence was reissued in \"Phantacea Revisited 1: \"The Damnation Brigade\" a graphic novel released by Phantacea Publications in late 2012 early 2013. Parts of the combined sequence were digitally re-lettered by Jim McPherson.",
	  NULL,NULL,NULL,NULL,1978,NULL
